// Import
import React from "react";

// Functional Component
const AboutUs = () => {
    return(
        <div className="about-container">
            <h1 id="about-title">About Us</h1>
            <p id="about-text">At Car Haven, we pride ourselves on providing the ultimate luxury car buying experience. Our dealership is home to a wide selection of the most sought-after exotic and luxury vehicles from top manufacturers such as Ferrari, Lamborghini, and Bugatti.</p>
            <p id="about-text">Our knowledgeable and friendly staff is dedicated to making sure each and every one of our customers leaves our showroom satisfied and behind the wheel of their dream car.</p>
            <p id="about-text">We also offer a variety of financing options to make your purchase as seamless as possible. Stop by our dealership today and see for yourself why Car Haven is the premier destination for luxury car buyers.</p>
        </div>
    )
};

// Export
export default AboutUs;

